import { Checkbox as BaseCheckbox, CheckboxSlot, } from "@microsoft/fast-components-react-base";
import checkboxSchema from "./checkbox.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { CheckboxStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Checkbox = manageJss(CheckboxStyles)(BaseCheckbox);
export { Checkbox, checkboxSchema, CheckboxSlot, };
